import React from 'react';

class Hello extends React.Component {
    render () {
        const randomNumber =()=>{
            return Math.floor(Math.random()*500);
        }

        const temp = randomNumber();
        return(
            <h1>The random number of the user is {temp} </h1>
        );
    }
}

export default Hello;
